import React from 'react';
import styled from 'styled-components';
import PostCard from './PostCard';
import { useFetchDashboardFeed } from '../hooks/dashboardFeed';

const Dashboard = () => {
  const {data: {posts}} = useFetchDashboardFeed();
  return (
	<Container>
    <PostContainer>
      <PostCard />
    </PostContainer>
  </Container>
  )
}

const Container = styled.div`
  flex: 1;
  width: 100%;
  display: flex;
  justify-content: center;
`

const PostContainer = styled.div`
  width: 500px;
`

export default Dashboard
